import React from 'react';
import axios from 'axios';
import Board from './Board';

function List() {

    const posts = Board.getPosts();

  return (
   <div>
      <h2>게시글</h2>
      <ul>
        {posts.map((post, index) => (
          <li key={index}>
            <strong>제목:</strong> {post.title}, <strong>글쓴이:</strong> {post.who}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default List;
